import React, { Component } from 'react';
import { Grid, AppBar, Toolbar, Typography, Button } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';

import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';

const styleAppBar = {
    backgroundColor: '#0A4776'
}

const styleTypography = {
    fontSize:'14px'
}

const styleShoppingCartIcon = {
    fontSize:'15px',
    marginRight:'5px'
}

class Header extends Component {
    state = {  }
    render() { 
        return (
            <AppBar style={styleAppBar} position='static'>
                <Toolbar>
                    <Grid container>
                        <Grid item xs={10}>
                            <Typography variant='h6'>
                                Aji-shop
                            </Typography>
                        </Grid>
                        <Grid item xs={2}>
                            <Button variant='contained' color='primary' fullWidth>
                                <ShoppingCartIcon style={styleShoppingCartIcon} />
                                <Typography style={styleTypography} variant='caption'>
                                    Cart
                                </Typography>
                                <Typography style={styleTypography} variant='subtitle'>
                                    Cart
                                </Typography>
                            </Button>
                        </Grid>
                    </Grid>
                </Toolbar>
            </AppBar>
        );
    }
}
 
export default Header;
